import React from "react"
import './App.css';

function App() {
  const [number,setNumber] = React.useState(0)
  function reduce(){
    return setNumber(number-1)
  }
  function add(){
    return setNumber(++number)
  }
  return (
    <div className="state--div">
       <h1>{number}</h1>
       <p className="left" onClick ={reduce}>-</p>
       <p className="right" onClick={add}>+</p>
    </div>
  );
}

export default App;
